import PropTypes from 'prop-types';

function List ({messages}) {
  console.log(messages)
  return (
    <div>List</div>
  )
}

List.propTypes = {
  messages: PropTypes.arrayOf(
    PropTypes.shape({
      id: PropTypes.number,
      title: PropTypes.string,
      status: PropTypes.number,
    }),
  ).isRequired,
};

export default List
